(2, '#DearFutureHusbad… from a different perspective..', '<blockquote style="text-align: center; margin: 0px 0px 0px 40px; border: none; padding: 0px;"><font size="5"><b>DEAR FUTURE HUSBAD</b></font></blockquote><blockquote style="margin: 0 0 0 40px; border: none; padding: 0px;"><blockquote style="margin: 0 0 0 40px; border: none; padding: 0px;"></blockquote></blockquote><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">About 3 months back, I started feeling like I was “more spiritual” (I’m not yet aware of the scriptural reference for this term, I wonder who started it) than the guys I’d been meeting. I’m learning to talk to God about <a href="tellit.com">EVERYTHING</a>. Many times, He interrupts my selfish thoughts. And as usual, I just see my intelligence is never enough.</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">…………………………………………….</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Me: (Pondering) I don’t want to be the spiritual leader of my home o</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Dad: Who says you are before?&nbsp;</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Me: Hehe, you know, I feel like I pray, worship, attend church programs and study than all these guys sef</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Dad: That’s what makes you the spiritual leader?</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Me: err.. I thought.. They say that the person that does those things more is the spiritual leader na</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Dad: I have chosen the male as the head of the home and that’s it. All you do could build your home, but baby girl, your husband is the head.</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Me: Silence. Breathes In. Okay, You win! You always win! I just wish #DearFutureHusband knows, wherever he is</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Dad: What if he hasn’t met and known me yet sef?</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Me: Uhn?!!! No way, I know he has.</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Dad: What if he hasn’t?</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Me: (Murmurs) I so have a lot to learn</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Dad: And unlearn…</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Me: silence.</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">…………………………………………………….</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><a class="_58cn" href="https://www.facebook.com/hashtag/dfh?source=feed_text&amp;story_id=223494781395488" data-ft="{" tn":"*n","type":104}"="" style="color: rgb(54, 88, 153); cursor: pointer; font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal; background-color: rgb(255, 255, 255);"><span class="_5afx" style="direction: ltr; unicode-bidi: isolate;"><span aria-label="hashtag" class="_58cl _5afz" style="unicode-bidi: isolate; color: rgb(66, 103, 178);">#</span><span class="_58cm">DFH</span></span></a><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">, I trust we share the same faith and eternal hope in Christ. I do pray we meet but I know that if we don’t, it’s because there’s something more beautiful, <a href="www.tellit.com">where marriage don’t even matter</a>. Looking forward to the endless ecstasy there much more than the pleasure here.</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Your number one fan,</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">-Top’Kit</span>', 'articles/2/6ab97ec3a9d863da8ccdda9158d0bc26.jpeg', 1, 0, 0, 0, 0, 2, '2016-11-24 11:47:14', '2016-11-24 21:27:17', 'About 3 months back, I started feeling like I was “more spiritual” (I’m not yet aware of the scriptural reference for this term, I wonder who started it) than the guys I’d been meeting. I’m learning to talk to God abt EVERYTHING. Many times, He interrupts my selfish thoughts. And as usual, I just see my intelligence is never enough.', NULL),
