(9, 'Title For Article Mindmup', '<ul style="padding: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 25px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal; background-color: rgb(255, 255, 255);"><li style="line-height: 20px;">Automatically binds standard hotkeys for common operations on Mac and Windows</li><li style="line-height: 20px;">Drag and drop files to insert images, support image upload (also taking photos on mobile devices)</li><li style="line-height: 20px;">Voice dictation input (only in Chrome)</li><li style="line-height: 20px;">Allows a custom built toolbar, no magic markup generators, enabling the web site to use all the goodness of Bootstrap, Font Awesome and so on...</li><li style="line-height: 20px;">Does not force any styling - it''s all up to you</li><li style="line-height: 20px;">Uses standard browser features, no magic non-standard code, toolbar and keyboard configurable to execute any&nbsp;<a href="https://developer.mozilla.org/en/docs/Rich-Text_Editing_in_Mozilla" style="color: rgb(0, 136, 204);">supported browser command</a></li><li style="line-height: 20px;">Does not create a separate frame, backup text areas etc - instead keeps it simple and runs everything inline in a DIV</li><li style="line-height: 20px;">(Optionally) cleans up trailing whitespace and empty divs and spans</li><li style="line-height: 20px;">Requires a modern browser (tested in Chrome 26, Firefox 19, Safari 6, reported by users to work in IE10)</li><li style="line-height: 20px;">Supports mobile devices (tested on IOS 6 Ipad/Iphone and Android 4.1.1 Chrome)</li></ul>', 'none', 1, 0, 0, 0, 0, 6, '2016-11-24 16:00:22', '2016-11-24 16:00:22', '<ul style="padding: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 25px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal; background-color: rgb(255, 255, 255);"><li style="line-height: 20px;">Automatically binds standard hotkeys for common operations on Mac and Windows</li><li style="line-height: 20px;">Drag and drop files to insert images, support image upload (also taking photos on mobile devices)</li><li style="line-height: 20px;">Voice dictation input (only in Chrome)</li><li style="line-height: 20px;">Allows a custom built toolbar, no magic markup generators, enabling the web site to use all the goodness of Bootstrap, Font Awesome and so on...</li><li style="line-height: 20px;">Does not force any styling - it''s all up to you</li><li style="line-height: 20px;">Uses standard browser features, no magic non-standard code, toolbar and keyboard configurable to execute any&nbsp;<a href="https://developer.mozilla.org/en/docs/Rich-Text_Editing_in_Mozilla" style="color: rgb(0, 136, 204);">supported browser command</a></li><li style="line-height: 20px;">Does not create a separate frame, backup text areas etc - instead keeps it simple and runs everything inline in a DIV</li><li style="line-height: 20px;">(Optionally) cleans up trailing whitespace and empty divs and spans</li><li style="line-height: 20px;">Requires a modern browser (tested in Chrome 26, Firefox 19, Safari 6, reported by users to work in IE10)</li><li style="line-height: 20px;">Supports mobile devices (tested on IOS 6 Ipad/Iphone and Android 4.1.1 Chrome)</li></ul>', NULL);
