 attend church programs and study than all these guys sef</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Dad: That’s what makes you the spiritual leader?</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Me: err.. I thought.. They say that the person that does those things more is the spiritual leader na</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Dad: I have chosen the male as the head of the home and that’s it. All you do could build your home, but baby girl, your husband is the head.</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Me: Silence. Breathes In. Okay, You win! You always win! I just wish #DearFutureHusband knows, wherever he is</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Dad: What if he hasn’t met and known me yet sef?</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Me: Uhn?!!! No way, I know he has.</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Dad: What if he hasn’t?</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Me: (Murmurs) I so have a lot to learn</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Dad: And unlearn…</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">Me: silence.</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><span style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;">…………………………………………………….</span><br style="color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal;"><a class="_58cn" href="https://www.facebook.com/hashtag/dfh?source=feed_text&amp;story_id=223494781395488" data-ft="{" tn":"*n","type":104}"="" style="color: rgb(54, 88, 153); cursor: pointer; font-family: Helvetica, Arial, sans-serif; font-size: 14px; letter-spacing: normal; background-color: rgb(255, 255, 255);"><span class="_5afx" style="direction: ltr; unicode-bidi: isolate;"><span aria-label="hashtag" class="_58cl _5afz" style="unicode-bidi: isolate; color: rgb(66, 103, 178);